import React, { Component } from 'react';

import './MainContainer.css';


import SideBar from '../SideBar/SideBar';


export class Container extends Component {
    render() {
        return (
            <div className="container">
              <Main/>
              <SideBar/>
            </div>
        )
    }
}

export default Container;
